import React, { useEffect } from 'react'
import Logincontent from "../components/logincontent/Logincontent"
import "./login.scss"


useEffect(() => {
  document.title = "Ani-Fox"

}, [])

export default function Login() {
  return (
    
    <div className="login">
        <Logincontent />
    </div>
  )
}
